INSERT INTO `faqs` VALUES (31,'<p>ما هي منظومة سابق؟<br></p>','<p>منظومة سابق للتوصيلات تعمل كوسيلة ربط إلكتروني بين الزبائن والشركاء (السائقين) والمتاجر.<br></p>',5,'2021-12-24 17:01:33','2021-12-24 17:01:33'),(32,'<p>من هو الشريك؟<br></p>','<p>الشريك هو من يقوم بعمليّة التوصيل (السائق) ونُسمّيه شريك لأنّنا نتشارك في خدمة التوصيل كلّها، حصّة الشريك 90% من قيمة التوصيل و10% هي حصّة سابق. لا ندفع أي أُجور ولا نوفّر وظائف ولكن نوفّر فُرص عمل بشراكة تحت ضوابط الشركة التنظيميّة والتعامليّة والأخلاقيّة.<br></p>',5,'2021-12-24 17:02:32','2021-12-24 17:02:32'),(33,'<p>كم تطبيق تحتوي المنظومة؟<br></p>','<p>3 تطبيقات: تطبيق للزبائن، وتطبيق للشركاء وتطبيق للمتاجر أو المطاعم. التطبيقات مربوطة كلّها ببعضها عن طريق خدمات سحابيّة تُدار من قبل برامج الذكاء الإصطناعي التي صُمّمت وتُدار من قبل مهندسينا.<br></p>',5,'2021-12-24 17:03:11','2021-12-24 17:03:11');
